import React, { Component } from 'react';

class GetDataUser extends Component {
  constructor(props) {
    super(props);
    this.state = {
      userData: null,
      loading: true,
      error: null,
    };
  }

  async componentDidMount() {
    try {
      const response = await fetch('https://d0ca-154-126-98-66.eu.ngrok.io/user/');
      const data = await response.json();
      this.setState({ userData: data, loading: false });
    } catch (error) {
      console.error(error);
      this.setState({ error: 'An error occurred', loading: false });
    }
  }

  render() {
    const { userData, loading, error } = this.state;

    if (loading) {
      return <div>Loading...</div>;
    }

    if (error) {
      return <div>{error}</div>;
    }

    return (
      <div>
        <h1>User Data:</h1>
        <p>{JSON.stringify(userData)}</p>
      </div>
    );
  }
}

export default GetDataUser;
